import React from 'react'

const SectionImg = ({title,p,button,btnClass,pClass,img}) => {
  return (
    <div className="imgs__text">
        <div>
    <h2>{title}</h2>
    <p className={pClass}>
      {p}
    </p>
    <button className={btnClass}>
      {button}
    </button>
  </div>
  <div>
      <img src={img} />
  </div>
  </div>
  )
}

export default SectionImg
